import React from 'react';
import { Card, Image, Rating } from 'semantic-ui-react';
import { withRouter } from 'react-router';
import defaultphoto from '../../src/defaultphoto.png'

const DoctorCard = (props) => {
  const { id, name, photos, formatted_address, rating, photo } = props.doctor;

  return (
    <Card onClick={(e) => props.history.push(`/doctors/${id}`)}>
      <Card.Content>
        <Card.Header>{name}</Card.Header>
      </Card.Content>
      {photo && <Image alt='' src={photo}/>}
      {!photo && <Image fluid centered size="mini" alt='' src={defaultphoto}></Image>}
      <Card.Content>

        {formatted_address}
        <Card.Meta><Rating rating={rating} maxRating={5} icon='star'></Rating></Card.Meta>

      </Card.Content>
    </Card>
  );
};

export default withRouter(DoctorCard);
